/**
 * 에러 페이지
 */
 import styled from 'styled-components';
 import palette from '../lib/styles/palette';
 const NotFoundBlock = styled.div`
 position: absolute;
 left: 0;
 top: 0;
 bottom: 0;
 right: 0;
 background: ${palette.gray[2]};
 display: flex;
 flex-direction: column;
 justify-content: center;
 align-items: center;
 


`;
const Box = styled.div`
.logo-area {
  display: block;
  padding-bottom: 1rem;
  text-align: center;
  font-weight: bold;
  letter-spacing: 2px;
}
box-shadow: 0 0 8px rgba(0, 0, 0, 0.025);
padding: 2rem;
width: 360px;
background: white;
border-radius: 2px;
text-align: center;

`
 const EditPostPage = () => {
   
   return (
   <NotFoundBlock>      
    <Box>
      <h1 className='logo-area'>Error 404</h1>
      <p>주소가 잘못되었나봐요...</p>
    </Box>
   </NotFoundBlock>);
 };
 
 export default EditPostPage;
